interface PrecioPropiedades {
  [key: string]: number;
}

const MexicoCityMap = () => {
  const [precioCasas, setPrecioCasas] = useState<PrecioPropiedades>({});
  const [precioDepartamentos, setPrecioDepartamentos] = useState<PrecioPropiedades>({});

  useEffect(() => {
    const fetchPrecios = async () => {
      try {
        const response_casas = await api.get('/api/casa/promedio-por-alcaldia');
        const data_casas = response_casas.data;
        setPrecioCasas(data_casas);

        const reponse_departamentos = await api.get('api/departamento/promedio-por-alcaldia');
        const data_departamentos = reponse_departamentos.data;
        setPrecioDepartamentos(data_departamentos);
      } catch (error) {
        console.error('Error fetching prices:', error);
        setPrecioCasas({});
        setPrecioDepartamentos({});
      }
    };
  
    fetchPrecios();
  }, []);

  // Static data indice de desarrollo social
  const indiceDesarrolloSocial = {
    "Azcapotzalco": "Medio",
    "Gustavo A. Madero": "Medio",
    "Miguel Hidalgo": "Alto",
    "Cuauhtémoc": "Medio",
    "Venustiano Carranza": "Medio",
    "Benito Juárez": "Muy alto",
    "Iztacalco": "Medio",
    "Álvaro Obregón": "Medio",
    "Cuajimalpa de Morelos": "Medio",
    "Coyoacán": "Medio",
    "Iztapalapa": "Bajo",
    "La Magdalena Contreras": "Bajo",
    "Tlalpan": "Bajo",
    "Xochimilco": "Bajo",
    "Tláhuac": "Bajo",
    "Milpa Alta": "Muy bajo"
  };

  const [option, setOption] = useState<string>("Precio promedio de casas");
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);
  const [hoveredAlcaldia, setHoveredAlcaldia] = useState<Alcaldia | null>(null);

  const handleOptionChange = (selectedOption: string) => {
    setOption(selectedOption);
    setIsDropdownOpen(false);
  };

  // Function to get current data based on selected option
  const getCurrentData = (): AlcaldiaData | AlcaldiaSocialData => {
    switch (option) {
      case "Precio promedio de casas":
        return precioCasas;
      case "Precio promedio de departamentos":
        return precioDepartamentos;
      case "Índice de Desarrollo Social":
        return indiceDesarrolloSocial;
      default:
        return precioCasas;
    }
  };

  // Function to determine color based on value
  const getColor = (alcaldiaId: string): string => {
    if (option === "Índice de Desarrollo Social") {
      const level = (indiceDesarrolloSocial as AlcaldiaSocialData)[alcaldiaId];
      switch (level) {
        case "Muy alto": return "#FF6A00"; // Dark orange
        case "Alto": return "#FF8D21"; // Strong orange
        case "Medio": return "#FFAD55"; // Medium orange
        case "Bajo": return "#FFCD90"; // Light orange
        case "Muy bajo": return "#FFE6B9"; // Very light orange
        default: return "#FFE6B9";
      }
    } else {
      // Numeric data handling
      const currentData = getCurrentData() as AlcaldiaData;
      const value = currentData[alcaldiaId];
      const maxValue = Math.max(...Object.values(currentData));
      const minValue = Math.min(...Object.values(currentData));
      const range = maxValue - minValue;
      const normalized = (value - minValue) / range * 100;
      
      if (normalized >= 80) return "#FF6A00"; // Dark orange
      if (normalized >= 60) return "#FF8D21"; // Strong orange
      if (normalized >= 40) return "#FFAD55"; // Medium orange
      if (normalized >= 20) return "#FFCD90"; // Light orange
      return "#FFE6B9"; // Very light orange
    }
  };

  // Function to get display value for tooltip
  const getDisplayValue = (alcaldiaId: string): string => {
    if (option === "Índice de Desarrollo Social") {
      return (indiceDesarrolloSocial as AlcaldiaSocialData)[alcaldiaId];
    } else {
      const currentData = getCurrentData() as AlcaldiaData;
      const value = currentData[alcaldiaId];
      return `$${Math.round(value).toLocaleString()} MXN`;
    }
  };

  // Function to get legend items
  const getLegendItems = () => {
    // Helper function to format numbers with commas
    const formatNumber = (num: number) => {
      return Math.round(num).toLocaleString();
    };
  
    if (option === "Índice de Desarrollo Social") {
      return [
        { color: "#FFE6B9", label: "Muy bajo" },
        { color: "#FFCD90", label: "Bajo" },
        { color: "#FFAD55", label: "Medio" },
        { color: "#FF8D21", label: "Alto" },
        { color: "#FF6A00", label: "Muy alto" }
      ];
    } else {
      const currentData = getCurrentData() as AlcaldiaData;
      const values = Object.values(currentData);
      const maxValue = Math.max(...values);
      const minValue = Math.min(...values);
      const step = (maxValue - minValue) / 5;
      
      return [
        { color: "#FFE6B9", label: `$${formatNumber(minValue)} - $${formatNumber(minValue + step)}` },
        { color: "#FFCD90", label: `$${formatNumber(minValue + step)} - $${formatNumber(minValue + step * 2)}` },
        { color: "#FFAD55", label: `$${formatNumber(minValue + step * 2)} - $${formatNumber(minValue + step * 3)}` },
        { color: "#FF8D21", label: `$${formatNumber(minValue + step * 3)} - $${formatNumber(minValue + step * 4)}` },
        { color: "#FF6A00", label: `$${formatNumber(minValue + step * 4)} - $${formatNumber(maxValue)}` }
      ];
    }
  };

  return (
    <div className="p-4">
      {/* Dropdown button */}
      <div className='flex justify-end relative mb-4'>
        <button
          className="flex items-center gap-2 px-3 py-1.5 text-sm border rounded-lg hover:bg-gray-50 bg-white text-gray-600"
          onClick={() => setIsDropdownOpen(!isDropdownOpen)}
        >
          {option}
          <ChevronDown className="w-4 h-4" />
        </button>
        {isDropdownOpen && (
          <div className="absolute top-full mt-1 right-0 rounded-md shadow-lg bg-white border z-20">
            <ul className="py-1">
              {[
                "Precio promedio de casas",
                "Precio promedio de departamentos",
                "Índice de Desarrollo Social"
              ].map((optionItem) => (
                <li
                  key={optionItem}
                  className="cursor-pointer hover:bg-gray-100 px-4 py-2 text-sm whitespace-nowrap"
                  onClick={() => handleOptionChange(optionItem)}
                >
                  {optionItem}
                </li>
              ))}
            </ul>
          </div>
        )}
      </div>
      
      {/* Map and color scheme */}
      <div className="flex flex-col items-center mx-auto">
        <div className="relative mb-6">
          <svg viewBox="-5 -10 460 650" className="w-full h-full max-w-lg">
            {alcaldias.map((alcaldia) => (
              <path
                key={alcaldia.id}
                id={alcaldia.id}
                d={alcaldia.path}
                fill={getColor(alcaldia.id)}
                stroke="#ffffff"
                strokeWidth="2"
                onMouseEnter={() => setHoveredAlcaldia(alcaldia)}
                onMouseLeave={() => setHoveredAlcaldia(null)}
                className="cursor-pointer hover:opacity-80 hover:-translate-y-0.5 duration-300"
              />
            ))}
          </svg>
          
          {/* Tooltip */}
          {hoveredAlcaldia && (
            <div className="absolute top-35 -left-50 bg-white py-3 px-4 rounded-md shadow-lg border border-gray-200 z-10 text-sm">
              <p className="font-semibold">{hoveredAlcaldia.name}</p>
              <p className="text-gray-600">{getDisplayValue(hoveredAlcaldia.id)}</p>
            </div>
          )}
        </div>

      </div>

      {/* Legend */}
      <div className=" mx-auto">
          <div className="flex justify-center items-center gap-6">
            {getLegendItems().map((item, index) => (
              <div key={index} className="flex items-center">
                <div 
                  className="w-4 h-4 mr-1 rounded-full border border-gray-300" 
                  style={{ backgroundColor: item.color }}
                ></div>
                <span className="text-sm text-gray-600">{item.label}</span>
              </div>
            ))}
          </div>
        </div>
    </div>
  );
};

export default MexicoCityMap;